import { Company } from '../../Entitis.type';
import { useState, useEffect } from 'react';
import '../../Design/GetAllCompanys.css'
import { useNavigate } from 'react-router-dom';

type Props = {
  token: string
};
const GetAllCompanys = (props: Props) => {
  const navigate = useNavigate();
  // //context.type
  const [company, setCompany] = useState<Array<Company>>([]);
  console.log(props.token);
  
  useEffect(() => {
    fetch('http://localhost:8080/admin/company/all', {
      method: 'GET',
      headers: {
        'Authorization': props.token,
        'Content-Type': 'application/json',
      },
      mode: 'cors'
    }).then((res) => res.json()).then((data) => {
      setCompany(data)
      console.log(data); // log response data to console
    }).catch((error) => console.log(error));
  }, []); // add empty array to run useEffect only once on component mount

  
    return (
<div className='getAllCompanys'>
  <button onClick={() => navigate(-1)}>Back</button> {/* add "Back" button */}
  <div className='table-header'>
    <div className='header-cell'>Company Name</div>
    <div className='header-cell'>Coupons</div>
  </div>
  {company.map((companys) => {
    return (
      <div key={companys.id} className='company'>
        <div className='company-name'>{companys.name}</div>
        <div className='coupons'>
          <div className='table-row'>
            <div className='table-cell'>Category</div>
            <div className='table-cell'>Price</div>
          </div>
          {companys.coupons.map((coupons) => {
            return (
              <div key={coupons.id} className='table-row'>
                {coupons.category && <div className='table-cell'>{coupons.category}</div>}
                {coupons.price && <div className='table-cell'>{coupons.price}</div>}
              </div>
            )
          })}
        </div>
      </div>
    )
  })}
</div>

  )
}

export default GetAllCompanys;
